import jwt from 'jsonwebtoken';
import config from '../config/config';
import exec from '../db/conexion';

export const checkRoleAuth = (roles) => async (req, res, next) => {

    const {
        token
    } = req.cookies

    console.log(token);
    jwt.verify(token, config.JWT_SECRET, async (err, data) => {
        console.log(data);
        // if (err) {
        //     res.redirect('/login');
        //     if (!token) return res.redirect('/login');
        // } else if (data.id) {
        //     const user = await exec('SP_GET_USUARIO', {
        //         USER_ID: data.id
        //     })).;
        //     if ([].concat(roles).includes(user[0].rol)) {
        //         req.user = data;
        //         return next();
        //     } else {
        //         res.redirect('/error-403')
        //     }
        // }
    })
}

