sourcesContent:
import jwt from 'jsonwebtoken';
import config from '../config/config';

export const checkTokens = async (res, req, next) => {
    try {
        const {
            _token
        } = req.cookies;

        console.log(_token);

        if (!_token) {
            return res.redirect('/login');
        }
        
        const decoded = jwt.verify(_token, config.SECRET);

        if (!decoded) {
            return res.redirect('/login');
        }

        req.user = decoded;
        return next();
    } catch (error) {
        return req.clearCookie('_token').redirect('/login');
    }

}

